import React from "react";

function Recipes() {
  const recipes = [
    {
      name: "Avocado Toast",
      desc: "Whole grain bread topped with smashed avocado, olive oil, and a sprinkle of seeds.",
    },
    {
      name: "Quinoa Salad",
      desc: "Fresh salad with quinoa, cucumber, tomato, chickpeas, and lemon dressing.",
    },
    {
      name: "Berry Smoothie",
      desc: "A refreshing blend of strawberries, blueberries, banana, and Greek yogurt.",
    },
    {
      name: "Grilled Salmon",
      desc: "Lightly seasoned salmon fillet with steamed broccoli and sweet potato.",
    },
  ];

  return (
    <div className="page">
      <h1 className="page-title">Healthy Recipes</h1>
      <p className="page-subtitle">Nutritious meals that taste as good as they look üç¥</p>

      <div className="cards">
        {recipes.map((recipe, index) => (
          <div key={index} className="card">
            <h2>{recipe.name}</h2>
            <p>{recipe.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Recipes;
